    void MeshComponent::Start()
    {
        Component::Start();

        m_Texture = Texture::LoadTexture("resources/uv.jpg");

        SetMeshType(Type);
        SetShader(Shader::CreateFromFiles("resources/Shader.vert", "resources/Shader.frag"));
    }

    void MeshComponent::SetMeshType(MeshComponentType type)
    {
        Type = type;
        switch (Type)
        {
        case MeshComponentType::Cube:
            CubeMesh.Generate();
            SetMesh(&CubeMesh);
            break;
        case MeshComponentType::Sphere:
            SphereMesh.Generate();
            SetMesh(&SphereMesh);
            break;
        case MeshComponentType::Plane:
            PlaneMesh.Generate();
            SetMesh(&PlaneMesh);
            break;
        default:
            SetMesh(nullptr);
            break;
        }
    }

#if CY_EDITOR
    void MeshComponent::EditorTick(float deltaTime)
    {
        if (LastType != Type)
        {
            SetMeshType(Type);
            LastType = Type;
        }
    }
#endif
